import { useEffect, useState } from "react";
import { allMoney } from "../../share/Money";

function Body() {
  const [moneyList, setMoney] = useState([]);
  useEffect(() => {
      const makeMoney = async () => {
    try {
        console.log("askdkfskd");
        const result = await allMoney();
        setMoney(result);
    } catch (error) {
        console.log(error);
    }
};
    makeMoney()    
  }, []);

  return (
    <div className="Wrapper">
      <ul>
        {moneyList.map((el)=>{return el.name})}
      </ul>
    </div>
  );
}

export default Body;
